import React from "react";

export default function PokedexEntry({ species }) {
  return (
    <div>
      <h2>Pokedex Entry</h2>
      {species &&
        species.flavor_text_entries
          .filter((entry) => entry.language.name === "en")
          .map((entry, index) => (
            <p key={index}>{entry.flavor_text}</p>
          ))}
    </div>
  );
}
